def col_name_decode(col_list, prefix = ''):
    decoded_to_original = {}
    for n,c in enumerate(col_list):
        c_split = c.upper().split('_')
        c_split = list(set(c_split)-set(prefix.upper().split('_')))
        key = '_'.join(sorted(c_split))
        decoded_to_original[key] = c
    return decoded_to_original

